import './Expenses.css';
import ExpenseItem from './ExpenseItem';
import Card from '../UI/Card';

const Expenses = (props) => {
  const expenses = props.data;

  return (
    <Card className="expenses">
      {expenses.map((x,i) => {
        return(
         <ExpenseItem
          key={i}
          title={x.title}
          amount={x.amount}
          date={x.date}
       />
        )
      })}
    </Card>
  );
};

export default Expenses;
